  useEffect(() => {
    const getRandomMovies = async () => {
      try {
        const res = await axios.get(`movies/random10`, {
          headers: {
            token: "lily eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYyNzU1ZGU0ZWYzNjYwN2I4N2RiMTA4YSIsImlhdCI6MTY1MTg2MjAxMiwiZXhwIjoxNjUyMjk0MDEyfQ.0UAeeJJKRCU0iA1Z_pl9E1gLdAlVMk8GJdlmfD7Gly8"
          }
        });
        console.log(res);
        setList(res);
      } catch (err) {
        console.log(err);
      }
    };
    getRandomMovies();
  },[]);

  return (
    <div className = "home">
        <Navbar />
        <Feature type = "movie"/>
        <div>
          {list.data[0]}
        </div>
        {/* <List list = {list}/> */}
    </div>
  )
}
